import { useEffect,useState } from "react";
import axios from "axios";

export default function PersonFList(){
    const ulr = 'https://jsonplaceholder.typicode.com/users'
    const [usuarios,setUser] = useState([])

    useEffect(()=>{
        axios.get(ulr).then(req=>{
            const dadosusuarios=req.data
            setUser(dadosusuarios)
        })
    })
    const detalhes=()=>{
        return(
            <div>
                {usuarios.map(item=>
                    <ul>
                        <li key={item.id}>Nome:{item.name}</li>
                        <li key={item.id}>Email:{item.email}</li>
                        <li key={item.id}>Telefone:{item.phone}</li>
                        <li>Site:{item.website}</li>
                    </ul>)}
            </div>
        )
    }

    return(
        <table className="tabela">
            <tr>
                <td>Nome</td>
                <td>Email</td>
                <td>Acao</td>
            </tr>
            {usuarios.map(item=>
                <tr>
                    <td>{item.name}</td>
                    <td>{item.email}</td>
                    <td><button onClick={detalhes}>Detalhes</button> <button>Excluir</button></td>
                </tr>
                )}
        </table>
    )
}
